      out.write("<script>\r\n");
      out.write("// 수량 감소, 증가\r\n");
      out.write("$(\"#minusBtn\").on(\"click\", function() {\r\n");
      out.write("    let value = parseInt($(\"#quantity_id_0\").val()) || 0; // 값을 정수로 변환합니다.\r\n");
      out.write("    if (value > 1) { // 1 이상일 때만 감소하도록 합니다.\r\n");
      out.write("        $(\"#quantity_id_0\").val(value - 1);\r\n");
      out.write("    } else {\r\n");
      out.write("        $(\"#quantity_id_0\").val(1); // 0 이하로 내려가지 않도록 1로 고정합니다.\r\n");
      out.write("    }\r\n");
      out.write("});\r\n");
      out.write("\r\n");
      out.write("$(\"#plusBtn\").on(\"click\", function() {\r\n");
      out.write("    let value = parseInt($(\"#quantity_id_0\").val()) || 0; // 현재 값을 정수로 변환\r\n");
      out.write("    $(\"#quantity_id_0\").val(value + 1); // 1을 더한 후 다시 설정\r\n");
      out.write("});\r\n");
      out.write("</script>\r\n");
      out.write("\r\n");
      out.write("<script>\r\n");
      out.write("// 전체 버튼, 상품 버튼 체크 색상 변경\r\n");
      out.write("let allChecked = false;\r\n");
      out.write("\r\n");
      out.write("// 전체 체크 버튼 색 변경\r\n");
      out.write("$(\"#checkcolor1\").on(\"click\", function() {\r\n");
      out.write("    allChecked = !allChecked; // 전체 체크 상태 반전\r\n");
      out.write("\r\n");
      out.write("    // 전체와 상품 버튼 모두 같은 색으로 변경\r\n");
      out.write("    if (allChecked) {\r\n");
      out.write("        $(\"#checkcolor1, #checkcolor2\").css(\"background-color\", \"black\");\r\n");
      out.write("    } else {\r\n");
      out.write("        $(\"#checkcolor1, #checkcolor2\").css(\"background-color\", \"#eee\");\r\n");
      out.write("    }\r\n");
      out.write("});\r\n");
      out.write("\r\n");
      out.write("// 상품 체크 버튼\r\n");
      out.write("$(\"#checkcolor2\").on(\"click\", function() {\r\n");
      out.write("    const isCurrentlyChecked = $(\"#checkcolor2\").css(\"background-color\") === \"rgb(0, 0, 0)\"; // 현재 색상이 검정인지 확인\r\n");
      out.write("\r\n");
      out.write("    // 상품 버튼 색상 변경\r\n");
      out.write("    if (isCurrentlyChecked) {\r\n");
      out.write("        $(\"#checkcolor2\").css(\"background-color\", \"#eee\");\r\n");
      out.write("    } else {\r\n");
      out.write("        $(\"#checkcolor2\").css(\"background-color\", \"black\");\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    // 상품 버튼이 하나라도 해제되면 전체 버튼도 해제\r\n");
      out.write("    if ($(\"#checkcolor2\").css(\"background-color\") === \"rgb(238, 238, 238)\") {\r\n");
      out.write("        allChecked = false;\r\n");
      out.write("        $(\"#checkcolor1\").css(\"background-color\", \"#eee\");\r\n");
      out.write("    } else {\r\n");
      out.write("        // 상품 버튼이 모두 체크되면 전체 버튼도 체크\r\n");
      out.write("        allChecked = true;\r\n");
      out.write("        $(\"#checkcolor1\").css(\"background-color\", \"black\");\r\n");
      out.write("    }\r\n");
      out.write("});\r\n");
      out.write("</script>\r\n");
      out.write("<pre id=\"cookie-output\"></pre>\r\n");
      out.write("<script>\r\n");
      out.write("// 쿠키 가져오는 함수\r\n");
      out.write("function getCookie(name) {\r\n");
      out.write("    let cookieArr = document.cookie.split(\";\");\r\n");
      out.write("    for (let i = 0; i < cookieArr.length; i++) {\r\n");
      out.write("        let cookiePair = cookieArr[i].split(\"=\");\r\n");
      out.write("        if (name == cookiePair[0].trim()) {\r\n");
      out.write("            return decodeURIComponent(cookiePair[1]);\r\n");
      out.write("        }\r\n");
      out.write("    }\r\n");
      out.write("    return null;\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("//장바구니 쿠키 정보 가져오기\r\n");
      out.write("let basketItems = getCookie(\"basketItems\");\r\n");
      out.write("\r\n");
      out.write("// 쿠키 데이터 디버깅 로그\r\n");
      out.write("console.log(\"Raw cookie data:\", basketItems);\r\n");
      out.write("\r\n");
      out.write("try {\r\n");
      out.write("    // 쿠키가 있으면 JSON 파싱\r\n");
      out.write("    let items = basketItems ? JSON.parse(basketItems) : [];\r\n");
      out.write("\r\n");
      out.write("    // JSON 파싱 후 데이터 확인\r\n");
      out.write("    console.log(\"Parsed items:\", items);\r\n");
      out.write("\r\n");
      out.write("    // 2차원 배열 형태의 텍스트 생성\r\n");
      out.write("    let outputText = items.map(item => {\r\n");
      out.write("        // 디버깅용으로 각 필드 출력\r\n");
      out.write("        console.log(\"Processing item:\", item);\r\n");
      out.write("        console.log(\"상품 ID:\", item.id);\r\n");
      out.write("        console.log(\"상품명:\", item.pname);\r\n");
      out.write("        console.log(\"가격:\", item.price);\r\n");
      out.write("        console.log(\"수량:\", item.quantity);\r\n");
      out.write("\r\n");
      out.write("        return `[상품 ID: ");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${item.id || ''}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null));
      out.write(", 상품명: ");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${item.pname || ''}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null));
      out.write(", 가격: ");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${item.price || ''}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null));
      out.write(", 수량: ");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${item.quantity || ''}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null));
      out.write("]`;\r\n");
      out.write("    }).join(\"\\n\");\r\n");
      out.write("\r\n");
      out.write("    // 최종 생성된 outputText 확인\r\n");
      out.write("    console.log(\"Output text:\", outputText);\r\n");
      out.write("\r\n");
      out.write("    // 출력\r\n");
      out.write("    document.getElementById(\"cookie-output\").textContent = outputText;\r\n");
      out.write("} catch (e) {\r\n");
      out.write("    console.error(\"JSON 파싱 에러:\", e);\r\n");
      out.write("    document.getElementById(\"cookie-output\").textContent = \"쿠키를 불러오는 중 에러가 발생했습니다.\";\r\n");
      out.write("}\r\n");
